import React from "react";
import Navbarprofile from "./Components/Navbarprofile/Navbarprofile";
import Navprofile from "./Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { blue } from "@mui/material/colors";
import { useState } from "react";
//import "./Profile.css";
import Tabpanell from "./Components/Tabpanel/Tabpanell";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Collapse } from "mdbreact";
import { Grid } from "@mui/material";
const Test = () => {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "196vh",
      }}
    >
      <div
        style={{
          backgroundColor: "yellow",
          display: "inline-block",
          //position: "fixed",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          backgroundColor: "green",
          width: "185vh",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          //alignItems: "center",
          // height: "500px",
        }}
      >
        <div
          style={{
            backgroundColor: "blue",
            height: "65px",
            //position: "fixed",
            top: 0,
            left: 0,
            right: 0,
            //width: "1600px",
            //position: "fixed",
          }}
        >
          <Navbarprofile />
        </div>
        <div
          style={{
            backgroundColor: "orange",
            display: "inline-block",
            marginTop: "64px",
            // height: "65px",
            // width: "1600px",
            //position: "fixed",
          }}
        >
          <MDBContainer className="py-5 h-100">
            <MDBRow className="justify-content-center align-items-center h-100">
              <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
                <MDBCard>
                  <div
                    className="rounded-top text-white d-flex flex-row"
                    style={{
                      //backgroundColor: "#000",
                      height: "300px",
                    }}
                  >
                    <div
                      className="ms-4 mt-5 "
                      style={{
                        width: "150px",
                        marginLeft: "20px",
                        //marginRight: "0px",
                        //backgroundColor: "green",
                        height: "200px",
                        display: "flex",
                        flexDirection: "column",
                        //alignContent: "center",
                        //alignItems: "center",
                        //justifyContent: "space-between",
                      }}
                    >
                      <MDBCardImage
                        src="https://i.pinimg.com/564x/e1/be/95/e1be95e26e853c491ff3a09e6b996783.jpg"
                        alt="Generic placeholder image"
                        className="img-thumbnail"
                        fluid
                        style={{ width: "150px", zIndex: "0" }}
                      />

                      <div
                        style={{
                          marginTop: "10px",
                          //backgroundColor: "red",
                          display: "flex",
                          // justifyContent: "row",
                          // alignContent: "center",
                          marginRight: "0px",
                          // margin: "0px",
                          width: "150px",
                          padding: "0px",
                        }}
                      >
                        <MDBBtn
                          className="mx-2"
                          color="light"
                          rippleColor="dark"
                          style={{
                            height: "28px",
                            width: "135px",
                            fontSize: "18px",
                            // position: "fixed",
                            padding: "0px",
                            margin: "0px",
                            // zIndex: "0",
                            //textAlign: " right;",
                          }}
                        >
                          <div>Edit profile</div>
                        </MDBBtn>
                      </div>
                    </div>

                    <Grid
                      container
                      spacing={1}
                      //className="ms-3"
                      style={{
                        marginTop: "50px",
                        marginLeft: "50px",
                        //backgroundColor: "red",
                        display: "flex",

                        height: "180px",
                      }}
                    >
                      <Grid
                        xs={10}
                        sx={{
                          // backgroundColor: "green",
                          height: "40px",
                        }}
                      >
                        <MDBTypography
                          tag="h5"
                          style={{ marginRight: "45px", color: "black" }}
                        >
                          User name
                        </MDBTypography>
                      </Grid>
                      <Grid
                        xs={15}
                        sx={{
                          //backgroundColor: "yellow",
                          height: "130px",
                        }}
                      >
                        <MDBTypography
                          tag="p"
                          style={{
                            marginRight: "45px",
                            color: "grey",
                            fontSize: "13px",
                          }}
                        >
                          HOME ADRESS:
                          <br />
                          <br />
                          PHONE NUMBER:
                          <br />
                          <br />
                          AVERAGE RESPONSE TIME:
                          <br />
                          <br />
                          DESCRIPTION:
                        </MDBTypography>
                      </Grid>
                    </Grid>
                  </div>
                  <MDBCardBody
                    style={{
                      backgroundColor: "red",
                      margin: "0px",
                      padding: "0px",
                    }}
                  >
                    <Tabpanell />
                  </MDBCardBody>
                </MDBCard>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </div>
      </div>
    </div>
  );
};

export default Test;
